import json, os, datetime;

fpn_json_out = fpn_json;
list_instance_transforms = instance_transforms.split('&');

D = {};
 
D['datetime'] = str(datetime.datetime.now());
D['username'] = os.getenv('username');
D['fpn_json'] = fpn_json; 
D['level_instance_name'] = linst_name;
D['level_instance_ref'] = linst_path_reference;

list_comComponents = []

for i в диапазоне(len(тип_компонента) )):
 C = {};
 C['тип_компонента'] = тип_компонента[i];
 C['sm_path_reference'] = sm_path_reference[i];
 C[ 'sm_path_source'] = sm_path_source[i];
 C['comComponent_transform'] = str(comComponent_transform[i]);

 list_split_instance_transforms = list_instance_transforms[i].split(',') ;
 list_clean_instance_transforms = [];
 для j в диапазоне(len(list_split_instance_transforms)):
 j_clean = list_split_instance_transforms[j].replace('[','');
 j_clean = j_clean.replace(']','');
 if j_clean != ' ' и j_clean != '':
 #list_split_instance_transforms[j] = j_clean;
 list_clean_instance_transforms.append (j_clean);
 C['instance_transforms'] = list_clean_instance_transforms;
 list_comComponents.append(C);

D['comComponents'] = list_comComponents;
 
